enum AppVideoProvider { YouTube }class AppVideo {  final String id;  final String title;  final String url;  final String? uploader;  final String? thumbnail;  final DateTime? publishedAt;  String? publishedAtStr;  final String? description;  final AppVideoProvider provider;  AppVideo(      {required this.title,      required this.id,      required this.url,      this.uploader,      this.thumbnail,      this.publishedAt,      this.publishedAtStr,      required this.provider,      this.description}) {    if (this.publishedAtStr == null || this.publishedAtStr == "Unknown") {      this.publishedAtStr = this.publishedAt?.toString();    }  }  @override  String toString() {    return 'ID: $id , Title: $title, Uploader: $uploader, Published At: $publishedAtStr';  }}